import PropTypes from 'prop-types'
import React from 'react'

import './Tail.css'

const Tail = ({ index, color }) => (
    <div className={`tail ${color}`}>
        <span className="symbol">
            {index}
        </span>
    </div>
)

Tail.propTypes = {
    index: PropTypes.number.isRequired,
    color: PropTypes.string.isRequired,
}
export default Tail
